import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import Button from 'react-bootstrap/Button';
import ItemForm from "./ItemForm";
import './resources/Form.css'

const Contact = ({ setForm, formData, navigation }) => {
  const { no, little, fair } = formData;

  const { previous, next } = navigation;

  return (
    <div className="form">
      <h3>Har du nyligen fått andningsbesvär?</h3>
      <ItemForm label="Nej" name="no" value={no} onChange={setForm} />
      <ItemForm label="Ja, jag får andnöd vid lätt ansträngning men inte i vila" name="little" value={little} onChange={setForm} />
      <ItemForm label="Ja, jag känner viss andnöd i vila" name="fair" value={fair} onChange={setForm} />
      <ItemForm label="E-mail" name="email" value={email} onChange={setForm} />
      <ItemForm label="E-mail" name="email" value={email} onChange={setForm} />
      <div>
        <Button onClick={previous}>Previous</Button>{' '}
        <Button onClick={next}>Next</Button>
      </div>
    </div>
  );
};

export default Contact;
